const ADD_MESSAGE = "ADD-MESSAGE";
const UPDATE_MESSAGE_TEXT = "UPDATE-MESSAGE-TEXT";

export const onMessageChangeActionCreator = (text) => ({
  type: UPDATE_MESSAGE_TEXT,
  newMessage: text,
})

export const sendMessageActionCreator = () => ({ type: ADD_MESSAGE })

const initialState = {
  dialogs : [
    { name: "Sasha", id: 1, ava: "data:image/jpeg;base64,"},
    { name: "Dima", id: 2, ava: "data:image/jpeg;base64,"},
    { name: "Kiborg", id: 3, ava: "data:image/jpeg;base64,"},
    { name: "Kion", id: 4, ava: "data:image/jpeg;base64,"},
    { name: "Masya", id: 5, ava: "data:image/jpeg;base64,"}
  ],
  messages: [
    {message: "Hello, how are you?"},
    {message: "I'm fine, thank you"},
    {message: "Yo"},
    {message: "Yo"},
    {message: "Yo"}
  ],
  newMessage: "I've got it!!!"
}

const dialogsReducer = (state = initialState, action) => {
  switch (action.type) {
    case UPDATE_MESSAGE_TEXT:
      state.newMessage = action.newMessage;
      return state;
    case ADD_MESSAGE:
      state.messages.push({
        message: state.newMessage,
      })
      state.newMessage = "";
      return state;
    default:
      return state;
  }
}

export default dialogsReducer;